      out.write("\t\r\n");
      out.write("\t<p>\r\n");
      out.write("\t식사요법의 목표는 올바른 식습관과 생활습관으로 바꾸어 고혈압, 고지혈증 등의 대사이상을 교정하여 합병증을 예방하고, <BR>좋은 영양 상태를 유지하는 것입니다. <BR><BR> -->\r\n");
      out.write("\t\r\n");
      out.write("\t<div style=\"width:100%;\">\r\n");
      out.write("\t<FONT COLOR=\"f77900\"><h2>식사요법의 기본원칙</h2></FONT>\r\n");
      out.write("\r\n");
      out.write("\t<table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n");
      out.write("\t<tr>\r\n");
      out.write("\t\t<td valign=\"top\">1)&nbsp;</td>\r\n");
      out.write("\t\t<td>\r\n");
      out.write("\t\t섭취하는 음식과 운동, 그리고 인슐린이나 약물이 균형을 이루어 <b>혈당과 혈중 지질 농도가 가능한 한 정상과 가까운 수준으로 유지</b>되도록 합니다.\r\n");
      out.write("\t\t</td>\r\n");
      out.write("\t</tr>\r\n");
      out.write("\t<tr><td width=\"100%\" height=\"15\" colspan=\"2\"><div style=\"width:100%; height:1px; background:url('/image/food/dot_line.gif') repeat-x;\"></div></td></tr>\r\n");
      out.write("\t<tr>\r\n");
      out.write("\t\t<td valign=\"top\">2)&nbsp;</td>\r\n");
      out.write("\t\t<td>\r\n");
      out.write("\t\t<b>적절한 체중을 유지하도록 합니다.</b> 만약 열량을 과다하게 섭취하면 체중이 증가하여 혈당조절이 어렵고 고혈압과 심장질환의 위험성이 높아질 수 있으며, <B>필요량보다 열량을 너무 적게 섭취한다면, 성장기의 소아당뇨인의 경우 정상적인 성장과 발육을 어렵게 할 수 있습니다</B>.\r\n");
      out.write("\t\t</td>\r\n");
      out.write("\t</tr>\r\n");
      out.write("\t<tr><td width=\"100%\" height=\"15\" colspan=\"2\"><div style=\"width:100%; height:1px; background:url('/image/food/dot_line.gif') repeat-x;\"></div></td></tr>\r\n");
      out.write("\t<tr>\r\n");
      out.write("\t\t<td valign=\"top\">3)&nbsp;</td>\r\n");
      out.write("\t\t<td>\r\n");
      out.write("\t\t당뇨병성 신증, 망막증, 신경병증 그리고 동맥경화증 등의 <b>합병증을 예방하고 치료</b>하는데 도움이 됩니다.\r\n");
      out.write("\t\t</td>\r\n");
      out.write("\t</tr>\r\n");
      out.write("\t<tr><td width=\"100%\" height=\"15\" colspan=\"2\"><div style=\"width:100%; height:1px; background:url('/image/food/dot_line.gif') repeat-x;\"></div></td></tr>\r\n");
      out.write("\t<tr>\r\n");
      out.write("\t\t<td valign=\"top\">4)&nbsp;</td>\r\n");
      out.write("\t\t<td>\r\n");
      out.write("\t\t우리 몸에 필요한 여러 영양소는 몸 안에서 각각 다른 작용을 하여 영양소들 사이의 상호 보완관계를 유지하고 있으므로 어느 한 영양소라도 부족하거나 과다하게 섭취하면 영양의 균형이 깨어지게 됩니다. 따라서 <b>좋은 영양 상태를 유지</b>하도록 <b>다양한 식품을 적절하게 섭취하여 여러가지 영양소를 골고루 섭취</b>하도록 합니다.\r\n");
      out.write("\t\t</td>\r\n");
