      out.write("\t\t<td>\r\n");
      out.write("\t\t<b style=\"color:#f77900;\">3. 식이섬유소를 적절히 섭취합니다.</b><BR />\r\n");
      out.write("\t\t&nbsp;&nbsp;&nbsp;&nbsp;☞ 식이섬유소는 혈당과 혈종지방의 농도를 낮추므로 혈당조절과 심장순환계 질환의 예방에 도움이 됩니다.\r\n");
